('salem', 'salem@example.com', @salem_pfp, 'purrfect101', 'Salem is a mischievous, fearless cat who thinks hes the boss of the house. Known for his bold personality, Salem often surprises Sammie and Chris with his antics, like when he once defended Sammie from a tickling attack by biting Chriss feet. Salem has a strong bond with Sammie and will do anything to protect her from any perceived threatseven if that threat is just Chris trying to have a little fun. He loves exploring every nook and cranny of the house and has a particular fondness for chasing shadows.'),
('joy', 'joy@example.com', @joy_pfp, 'farmgirl789', 'Joy is a soon-to-be graduate and a self-proclaimed homebody, but shes been pushing herself to try new activities and step out of her comfort zone. Shes married to her high school sweetheart and has a tuxedo cat who keeps her company when shes at home. In the summer, Joy works on a farm, where she gets her hands dirty helping with crops and animals. While Joy prefers the quieter moments of life, shes excited about the future and is learning to embrace new experiences. Shes also studying computer science and cant wait to see where it takes her.'),
('ian', 'ian@example.com', @ian_pfp, 'outdooradventure123', 'Ian is a dedicated computer science student with a deep love for the outdoors. He manages his time well, balancing his academic life with his passion for outdoor activities, from hiking and camping to rock climbing. Originally from South Africa, Ian embraces his Christian faith and values the sense of community it brings. His ability to stay organized and focused allows him to excel both academically and in his personal life. When hes not coding or studying, youll find him exploring new places and seeking his next adventure.');

